import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import './semantic/dist/semantic.min.css';
import  Logo from './logo';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <Logo image={logo} />
        </header>
      </div>
    );
  }
}

export default App;
